(function(){Polymer.AppLayout.registerEffect('px-app-header-scroll-effect',{setUp:function(){this.navContainer={navElement:Polymer.dom(this).querySelector('[nav-container]')},this.navContainer.navHeight=parseInt(getComputedStyle(this.navContainer.navElement).height,10),this.navContainer.navElement.style.willChange='transform',this.headerContainer={headerElement:Polymer.dom(this).querySelector('[header-container]')},this.headerContainer.headerHeight=parseInt(getComputedStyle(this.headerContainer.headerElement).height,10),this.condensedHeaderSize=5<=this.headerContainer.headerHeight?5:0},run:function(a){var b=(this.navContainer.navHeight-this.headerContainer.headerHeight+this.condensedHeaderSize)*a;this.transform('translateY('+b+'px)',this.navContainer.navElement),0===a&&this.dispatchEvent(new CustomEvent('px-app-header-scroll-reset'))},tearDown:function(){this.navContainer.navElement.style.willChange='auto',delete this.navContainer,delete this.headerContainer}})})();